    false,nt"url": null,nt"notes": " n        The analysis of WtM credit used
    baseline and final follow-up Farming Practices Survey (FPS) data to summarize beneficiary
    and loan characteristics, as well as to estimate the impact of MCA credit on the
    key outcomes of investment, production, sales, and income. To construct these estimates,
    the evaluator used regression modeling to compare farmers who did and did not receive
    MCA credit. The evaluator supplemented the quantitative analysis with qualitative
    information on program implementation and intended results based on interviews with
    MCA staff, RFF personnel, lending organizations participating in the program, and
    representatives from other donor organizations in Armenia.n      ",nt"license_title":
